import React from 'react'
import { Label } from "semantic-ui-react"
const Profile = (props) => {
    return (
        <div style={{ float: "right", marginRight: "2vw", textAlign: "center", fontSize: "3vh" }}>
            <div>{props.Name}</div>
            <Label as='a' content=            <div>{props.Name}</div>
 />
        </div>

    )
}

export default Profile
